import React from 'react'

const Person = (props) => {
    return (
        <div>
            
            <h1 >
                <button onClick={props.click}>X</button>
                I am {props.name}
                <br />
            </h1>
            <input type="text" onChange={props.change} value={props.name}/>
        </div>
    )
}

export default Person
